import React from 'react';
import cover1 from './../assets/img/cover1.jpg';
import Data from './../data/data.json';

class Release extends React.Component{
    render () {
        return (
            <div className="release">
                <img src={cover1} alt="BoSsOb cover"></img>
                <div className="release-txt">
                    <h3 className="release-title underlined underlined--thin">{Data.title}</h3>
                    <h4 className="label underlined underlined--thin">{Data.label}</h4>
                    <h5 className="cat underlined underlined--thin">{Data.cat}</h5>
                    <h6 className="date underlined underlined--thin">{Data.date}</h6>
                    <ul className="tracklist">
                    <li>{Data.tracklist[1]}</li>
                    <li>{Data.tracklist[2]}</li>
                    <li>{Data.tracklist[3]}</li>
                    <li>{Data.tracklist[4]}</li>
                    </ul>
                </div>
            </div>
        );
    }
}

export default Release;
